import React from 'react';
import './taco.css';

const Taco = props => {
  return (
    <div>
      <h3>Build your taco</h3>
      <img src='../../assets/taco-2.jpg' alt='street tacos' />
      <form>
      <h1>Hello</h1>
    </form>
    </div>
    
  )
}

export default Taco;
